import React, { useState, useEffect } from "react";

function TutorDropdown() {
  const [tutors, setTutors] = useState([]);

  useEffect(() => {
    fetch("https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/show/tutors")
      .then((response) => response.json())
      .then((data) => {
        setTutors(data);
      })
      .catch((error) => {
        console.error("Error fetching tutors: ", error);
      });
  }, []);

  return (
    <div>
      <label htmlFor="tutor">Select a tutor:</label>
      <select id="tutor" name="tutor">
        {tutors.map((tutor) => (
          <option key={tutor.first} value={tutor.id}>
            {tutor.name}
          </option>
        ))}
      </select>
    </div>
  );
}

export default TutorDropdown;
